import { isLog } from "./../log_actionTypes";

const initialState = {
  loggedIn: false,
  ////For example const initialState = { person: null as Person };
};

type MyIsLoggedReducer = typeof initialState;

const IsLoggedReducer = (
  state = initialState,
  action: any
): MyIsLoggedReducer => {
  switch (action.type) {
    case isLog:
      return { ...state, loggedIn: true };
    default:
      return state;
  }
};

export default IsLoggedReducer;
